import React from "react";

const Footer = () => {
  return (
    <div>
      <h5>"Lo que no sé, lo aprendo."</h5>
      <button>Linkedin</button>
      <button>GitHub</button>
      <p>©Todos los derechos reservados. Joaquín Mussi 2021</p>
    </div>
  );
};

export default Footer;
